export enum PageNames {
  HOME = 'home',
  PROFILE = 'profile',
  SIGN_IN = 'sign-in',
}

export enum Languages {
  EN = 'en',
  TR = 'tr',
}

export enum Locales {
  EN = 'en-US',
  TR = 'tr-TR',
}

export enum PageURLs {
  HOME = '/',
  PROFILE = '/profile',
  SIGN_IN = '/sign-in',
  WILD_CARD = '*',
}

export enum SideBarElementInfoTexts {
  FEED = 'feed',
  CHATS = 'chats',
  VIDEOS = 'videos',
  GROUPS = 'groups',
  BOOKMARKS = 'bookmarks',
  QUESTIONS = 'questions',
  JOBS = 'jobs',
  EVENTS = 'events',
}

export enum Types {
  SUBMIT = 'submit',
}

export enum SignInPageFields {
  EMAIL = 'email',
  PASSWORD = 'password',
}

export enum PlaceHolders {
  EMAIL = 'example@domain.com',
  PASSWORD = '*********',
}

export enum APIMethods {
  GET = 'GET',
  POST = 'POST',
  PUT = 'PUT',
  DELETE = 'DELETE',
  CREATE = 'CREATE',
}

export enum Events {
  LANGUAGE_CHANGED = 'languageChanged',
}

export enum ErrorCode {
  WILD_CARD = '404',
}

export enum Common {
  TOKEN = 'token',
}
